import React from "react";

const Footer = () => {
  return (
    <>
      <div className="Quiz_container_Footer">
        <a href="https://play.google.com/store/apps/details?id=com.divetolearn">
          <button type="btn">To Know More Visit Our App</button>
        </a>
      </div>
    </>
  );
};

export default Footer;
